import React from "react";
import TeamMember from "./teammember";





function team() {    
       
   const info =           
      [
      {
         id: '1',
         img: 'https://picsum.photos/20',
         name: "Saoud",
         phone: "090881346",
         email: "ee@ss.com"
      },
      {
         id: '3',
         img: 'https://picsum.photos/71',
         name: "Mohmad",
         phone: "090881346",
         email: "ee@ss.com"
      },

      {
         id: '5',
         img: 'https://picsum.photos/76',
         name: "samer",
         phone: "090881346",
         email: " "
      },
      {
         id: '2',
         img: 'https://picsum.photos/78',
         name: "mazen",
         phone: "090881346",
         email: " "
      },
   ]

let members = info.map(function (member) {
   return (

      <TeamMember
      id={member.id}
      img ={member.img}
      name={member.name}  
      email={member.email}
      phone={member.phone} />) 
   
   
})

   return (
      <div className="row container justify-content-center ">
      {members}
   </div>
)
}
 
export default team
